INSERT INTO `books` (`id`, `title`, `isbn`, `author`, `publish_date`, `publisher`, `price`, `category_id`, `image`, `description`) VALUES
(1, 'Adobe Photoshop CSS6 Digital Classroom', '1118123891', 'Jennifer Smith, AGI Creative Team', '2012-06-13', 'Wiley', '45.95', 4, 'https://images-na.ssl-images-amazon.com/images/I/51ihfygiXUL._SX399_BO1,204,203,200_.jpg', 'The Digital Classroom series combines a full-color book with a full-featured DVD, resulting in a complete training package written by expert instructors. Photoshop is the industry standard for image editing, and this guide gets photographers, commercial designers, web developers, fine artists, and serious hobbyists up to speed on the newest version. It includes 13 self-paced lessons that allow you to progress at your own speed, with complete lesson files and tutorials on the DVD. Topics include Camera RAW, masks and layers, retouching, and much more.'),
(3, 'Cracking the SAT, 2013 Edition', '0307944786', 'Princeton Review', '2012-05-22', 'Princeton Review', '15.98', 1, 'https://images-na.ssl-images-amazon.com/images/I/51enZvG1A-L._SX384_BO1,204,203,200_.jpg', 'If you need to know it, it&#39;s in this book! Cracking the SAT, 2013 Edition includes everything you need to know to master the Math, Critical Reading, and Writing sections of the SAT.'),
(5, 'The Greater Journey: Americans in Paris', '1416571779', 'David McCullough', '2012-05-15', 'Simon & Schuster', '11.00', 2, 'https://images-na.ssl-images-amazon.com/images/I/51JJHuTclXL._SX336_BO1,204,203,200_.jpg', 'World and Amerdistory'),
(20, 'asdf', 'asdf', 'asdf', '0000-00-00', 'f', '0.02', 2, 'https://images-na.ssl-images-amazon.com/images/I/519R85lQUCL._SX381_BO1,204,203,200_.jpg', 'asdf'),
(21, 'adf', 'asdf', 'asdf', '0000-00-00', 'asdf', '0.02', 1, 'asdf', 'asdf'),
(22, 'asdf', 'adsf', 'asf', '0000-00-00', 'aaf', '0.01', 1, 'asdf', 'as'),
(10, 'Java Foundations (3rd Edition) ', '0133370461 ', 'John Lewis ', '2013-03-08', 'Addison-Wesley', '130.58', 4, 'http://ecx.images-amazon.com/images/I/51QB-ZuHAbL.jpg', 'Inspired by the success of their best-selling introductory programming text, Java Software Solutions, authors Lewis, DePasquale, and Chase now release Java Foundations, Third Edition. This text is a comprehensive resource for instructors who want a two-or three-semester introduction to programming textbook that includes detail on data structures topics. Java Foundations introduces a Software Methodology early on and revisits it throughout to ensure students develop sound program development skills from the beginning. Control structures are covered before writing classes, providing a solid foundation of fundamental concepts and sophisticated topics. '),
(11, 'A Brief History of Time: From the Big Bang to Black Holes ', '0553380168', 'Stephen Hawking', '1998-09-01', 'Bantam', '9.00', 3, 'http://ecx.images-amazon.com/images/I/61RD%2BMeYtsL.jpg', 'A landmark volume in science writing by one of the great minds of our time, Stephen Hawking\'s book explores such profound questions as: How did the universe begin-and what made its start possible? Does time always flow forward? Is the universe unending-or are there boundaries? Are there other dimensions in space? What will happen when it all ends?\r\n\r\nTold in language we all can understand, A Brief History of Time plunges into the exotic realms of black holes and quarks, of antimatter and \"arrows of time,\" of the big bang and a bigger God-where the possibilities are wondrous and unexpected. With exciting images and profound imagination, Stephen Hawking brings us closer to the ultimate secrets at the very heart of creation.'),
(12, 'Undeniable: Evolution and the Science of Creation', '1250007135 ', 'Bill Nye, Corey S. Powell', '2014-11-04', ' St. Martin\'s Pres', '16.75', 3, 'http://ecx.images-amazon.com/images/I/51jIthhp2HL.jpg', '\"Evolution is one of the most powerful and important ideas ever developed in the history of science. Every question it raises leads to new answers, new discoveries, and new smarter questions. The science of evolution is as expansive as nature itself. It is also the most meaningful creation story that humans have ever found.\" -- Bill Nye'),
(13, 'How We Got to Now: Six Innovations That Made the Modern World', '1594632960', 'Steven Johnson', '2014-09-30', 'Riverhead Hardcover', '20.26', 3, 'http://ecx.images-amazon.com/images/I/81JaldAmMiL.jpg', 'In this illustrated history, Steven Johnson explores the history of innovation over centuries, tracing facets of modern life (refrigeration, clocks, and eyeglass lenses, to name a few) from their creation by hobbyists, amateurs, and entrepreneurs to their unintended historical consequences. Filled with surprising stories of accidental genius and brilliant mistakes - from the French publisher who invented the phonograph before Edison but forgot to include playback, to the Hollywood movie star who helped invent the technology behind Wi-Fi and Bluetoothï¿½How We Got to Now investigates the secret history behind the everyday objects of contemporary life.'),
(14, 'Where Good Ideas Come From', '1594485380', 'Steven Johnson', '2011-10-04', 'Riverhead Trade', '17.18', 3, 'http://ecx.images-amazon.com/images/I/41OyN%2BFRajL.jpg', 'The printing press, the pencil, the flush toilet, the battery--these are all great ideas. But where do they come from? What kind of environment breeds them? What sparks the flash of brilliance? How do we generate the breakthrough technologies that push forward our lives, our society, our culture? Steven Johnson\'s answers are revelatory as he identifies the seven key patterns behind genuine innovation, and traces them across time and disciplines. From Darwin and Freud to the halls of Google and Apple, Johnson investigates the innovation hubs throughout modern time and pulls out the approaches and commonalities that seem to appear at moments of originality.'),
(15, 'Learning PHP, MySQL & JavaScript: With jQuery, CSS & HTML5', '978-1491918661', 'Robin Nixon', '2014-12-14', 'O&#39;Reilly Media', '35.25', 4, 'http://ecx.images-amazon.com/images/I/81Q0deul8FL.jpg', 'It is all about the practical use of science and knowledge to solve problems.'),
(16, 'PHP and MySQL Web Development', '0672329166', 'Luke Welling, Laura Thomson', '2008-10-11', 'Addison-Wesley Professional', '29.99', 4, 'http://ecx.images-amazon.com/images/I/51AigeIv7OL._SX387_BO1,204,203,200_.jpg', 'PHP and MySQL are popular open-source technologies that are ideal for quickly developing database-driven Web applications. PHP is a powerful scripting language designed to enable developers to create highly featured Web applications quickly, and MySQL is a fast, reliable database that integrates well with PHP and is suited for dynamic Internet-based applications.'),
(17, 'PHP Advanced and Object-Oriented Programming: Visual QuickPro Guide', '0321832183', 'Larry Ullman', '2012-09-23', 'Peachpit Press', '38.95', 4, 'http://ecx.images-amazon.com/images/I/51ruNhq9asL._SX382_BO1,204,203,200_.jpg', 'Readers can take their PHP skills to the next level with this fully revised and updated PHP Advanced: Visual QuickPro Guide, Third Edition! Filled with fourteen chapters of step-by-step content and written by bestselling author and PHP programmer Larry Ullman, this guide teaches specific topics in direct, focused segments, shows how PHP is used in real-world applications. The book teaches developing web applications using advanced PHP techniques and advanced database concepts, and this edition offers several chapters devoted to object-oriented programming and all-new chapters on debugging, testing, and performance. Author hosts a popular companion website at larryullman.com, where readers can freely download code used in the book, access a user forum and book updates, and get advice directly from the author.'),
(18, 'Java: A Beginner\'s Guide, Sixth Edition', '0071809252', 'Herbert Schildt', '2014-05-06', 'McGraw-Hill Education', '19.78', 4, 'http://ecx.images-amazon.com/images/I/51bSQY6AZhL._SX404_BO1,204,203,200_.jpg', 'Fully updated for Java Platform, Standard Edition 8 (Java SE 8), Java: A Beginner\'s Guide, Sixth Edition gets you started programming in Java right away. Bestselling programming author Herb Schildt begins with the basics, such as how to create, compile, and run a Java program. He then moves on to the keywords, syntax, and constructs that form the core of the Java language. This Oracle Press resource also covers some of Java\'s more advanced features, including multithreaded programming, generics, and Swing. Of course, new Java SE 8 features such as lambda expressions and default interface methods are described. An introduction to JavaFX, Java\'s newest GUI, concludes this step-by-step tutorial.'),
(19, 'S', 'f', 'D', '0000-00-00', 'f', '0.03', 2, 'a', 'd');
