INSERT INTO `games` (`games_id`, `title`, `price`, `system_id`, `publisher_id`, `publish_year`, `genre`, `rating_id`, `image`, `description`) VALUES
(3, 'Pikmin', '79.99', 3, 1, 2001, 'Strategy', 3, 'http://localhost/i211-final/gameShack_mvc/www/img/games/pikmin.jpg', 'Captain Olimar is an intrepid space traveller from the planet Hocotate. In his ship the Dolphin Olimar retrieves precious items and materials for his homeworld. On one voyage, however, a meteor strikes his ship, forcing him into a crash landing on a mysterious world. Pieces of the Dolphin are scattered as it crashes, and though Olimar survives, the situation is grim. The batteries on his life-support system will die in thirty days, after which he&#39;ll be at the mercy of the planet&#39;s toxic oxygen atmosphere. But there may be hope: shortly after his arrival, Olimar discoveres strange creatures called Pikmin that obey his commands after he plucks them from the ground. With their help, Olimar works to collect the vital pieces of his ship so he can safely return home.'),
(5, 'Superman: Shadow of Apokolips', '24.35', 4, 3, 2002, 'Action', 3, 'http://localhost/i211-final/gameShack_mvc/www/img/games/superman_shadow_of_apokolips.jpg', 'Believing Intergang to be starting up again, Superman learns that beings causing chaos throughout Metropolis are in-fact a group of robots using Intergang&#39;s old methods. These &#34;Interbots&#34; have access to very high-grade weaponry, which is powerful enough to seriously injure or even kill the Man of Steel. These bots are being ordered by a leader that is later revealed to be Lex Luthor.\r\n\r\nFinding that the weapons come from Apokolips, Superman sets out to destroy the bots, and their weapons, having to fight a multitude of enemies that Luthor sends after him. Parasite and Metallo are both contracted to kill Superman to allow the bots free reign to obey Luthor&#39;s wishes.'),
(9, 'Animal Crossing: New Leaf', '48.99', 6, 1, 2012, 'Simulation', 3, 'http://localhost/i211-final/gameShack_mvc/www/img/games/animal_crossing_new_leaf.jpg', 'The player moves to town by train and is greeted by Rover, whose questions determine the player&#39;s appearance. When the first player arrives in town, they are greeted by Isabelle and three villagers, who believe them to be the new mayor of the town; all subsequent players are greeted as standard residents. Isabelle, the mayor&#39;s secretary, takes the player to town hall, where she gives the player a Town Pass Card and tells them to go to Tom Nook at Nook&#39;s Homes to buy a house. After the player chooses a location for their house, Isabelle tells the player they need to increase their approval rating as mayor, which is done by performing various tasks. When the player&#39;s approval rating reaches 100%, the ability to build public works projects and enact a ordinance is unlocked.'),
(10, 'Kingdom Hearts', '22.50', 4, 1, 2002, 'Role-Playing', 3, 'http://localhost/i211-final/gameShack_mvc/www/img/games/kingdom-hearts-1.jpg', 'Kingdom Hearts begins with Sora&#39;s Dive to the Heart, which foreshadows the events that will soon take place, but soon progresses to Destiny Islands, where Sora lives with his two best friends, Riku and Kairi. The three friends seek to leave the islands to explore new worlds and have prepared a raft for this purpose. One night, the islands are attacked by darkness and shadow creatures. Sora seeks out his friends, finding Riku first; Riku disappears into darkness, curious about what it contains. Soon after, Sora obtains a mysterious weapon, the Keyblade, to defend himself. Using it to fend off the creatures, he heads for a secret cave, where he finds Kairi near a door. She turns to him, saying his name as the door behind her blows open. The ensuing blast of darkness sends Sora and Kairi both out of the cave. The islands are soon destroyed, and Sora is left adrift, Riku and Kairi&#39;s whereabouts unknown.'),
(21, 'Super Mario 64', '19.50', 7, 1, 1996, 'Simulation', 3, 'http://localhost/i211-final/gameShack_mvc/www/img/games/super_mario_64.jpg', 'Of all the items in the Mushroom Kingdom, the Power Stars are the most magical and powerful. These 120 stars power Princess Toadstool&#39;s castle. One day, the Princess invites Mario over for a cake-but while he&#39;s getting there, Bowser is invading! The King of the Koopas goes into Mushroom Castle and steals most of the power stars-the others are hidden by Peach and her Toad subjects. But alas-Bowser takes enough to not only create his own strange and twisted worlds from paintings in the castle, but to imprison Peach and her Toads in the castle walls themselves! But Bowser didn&#39;t count on one mustached plumber, whose mission is to recover the stolen stars and bring their power back!'),
(22, 'Legend of Zelda: Ocarina of Time', '42.45', 7, 1, 1998, 'Fantasy Action-Adventure', 3, 'zelda_ocarina_of_time.jpg', 'Link, the Hero of Time, has been awakened by the fairy Navi. The fairy warns him of The Great Calamity: Ganondorf. Traveling across the land of Hyrule, Link must save the kingdom and Princess Zelda from Ganon&#39;s plot to obtain the ultimate power in all the land: The Triforce. With the help of The Seven Sages and the elusive Sheik, Link will embark on the quest of a lifetime to stop Ganondorf once and for all.'),
(23, 'Jet Force Gemini', '14.55', 7, 1, 1999, 'Action-adventure Game', 3, 'jetforce_gemini.jpg', 'Jet Force Gemini revolves around the galactic law enforcement team Jet Force Gemini attempting to stop a horde of drones led by an insectoid called Mizar. The team is composed of Juno, Vela, and their wardog mascot Lupus. The game begins with the three characters in orbit around the planet Goldwood after barely escaping the destruction of the entire Jet Force fleet at the hands of Mizar, who has been capturing and enslaving a race of survivors known as the Tribals. When Juno, Vela and Lupus are attacked by several drones, the three decide to abandon their ship and go off on their own separate paths to stop the invasion. After traversing various planets, the heroes find themselves reunited at Mizar&#39;s Palace and face to face with Mizar, who escapes to a nearby asteroid where he sets course to impact with Earth. To help the heroes, Tribals leader King Jeff provides them with an ancient starship that can quickly catch up to Mizar&#39;s asteroid. In return, the team must rescue all the Tribals throughout the galaxy.'),
(25, 'The Elder Scrolls V: Skyrim', '30.50', 5, 7, 2011, 'Fantasy/Action Role-Playing', 2, 'http://localhost/i211-final/gameShack_mvc/www/img/games/skyrim.jpg', 'The Empire of Tamriel is on the edge. The High King of Skyrim has been murdered. Alliances form as claims to the throne are made. In the midst of this conflict, a far more dangerous, ancient evil is awakened. Dragons, long lost to the passages of the Elder Scrolls, have returned to Tamriel. The future of Skyrim, even the Empire itself, hangs in the balance as they wait for the prophesized Dragonborn to come; a hero born with the power of The Voice, and the only one who can stand amongst the dragons.'),
(26, 'Super Mario Galaxy', '21.20', 1, 1, 2007, 'Action-Adventure', 3, 'super_mario_galaxy.jpg', 'Super Mario Galaxy, unlike the other Mario games, takes place in deep space. Most of the game&#39;s levels consist of many small planets and planetoids, with some as big as real life planets. The game has 121 Stars to collect, although the player will have to go through the first 120 Stars twice (once as Mario and once as Luigi) to unlock the 121st and final Star.'),
(27, 'World of Warcraft', '16.55', 5, 10, 2004, 'Multiplayer Role-Playing', 2, 'http://localhost/i211-final/gameShack_mvc/www/img/games/world_of_worldcraft.jpg', 'Humans and orcs clash in this feature-film adaptation of the popular fantasy video-game series. After realizing that their home is becoming uninhabitable, a race of orcs travel to the land of Azeroth. There, they encounter the realm&#39;s human denizens, who fight back against the invaders. In time, an orc warrior (Toby Kebbell) forges an alliance with a group of humans in order to overthrow his race&#39;s corrupt leader (Daniel Wu) and bring peace to the land.'),
(28, 'Bioshock Infinite', '29.99', 2, 9, 2013, 'First-person shooter', 1, 'http://localhost/i211-final/gameShack_mvc/www/img/games/bioshock_infinite.jpg', 'After traveling by boat along the Coast of Maine with two mysterious figures, Booker soon finds himself in a lighthouse, which he uses to ascend to Columbia. He passes out during the trip, awakening in a church-like area. When he asks where he is, one member of the congregation tells him he&#39;s in Heaven, or &#34;the closest he&#39;ll get until Judgment Day.&#34;'),
(29, 'Kirby: Star Allies', '52.85', 8, 1, 2018, 'Platform', 3, 'http://localhost/i211-final/gameShack_mvc/www/img/games/kirby_star_allies.jpg', 'Classic Kirby enemies are his new best friends!\r\nWhen an evil threatens Planet Popstar, Kirby will need a little help from his...enemies?! By making friends out of foes, up to three** players can drop in or out of the adventure at any time. With expanded copy abilities, classic Kirby action is even deeper: combine abilities with elements such as ice or fire to create friend abilities!'),
(32, 'Tales of Symphonia', '18.20', 4, 11, 2003, 'Action Role-Playing', 4, 'http://localhost/i211-final/gameShack_mvc/www/img/games/tales_of_symphonia.jpg', 'Lloyd Irving and his friend, Genis Sage accompany the chosen, Colette Brunel and her guardians, Raine Sage and Kratos Aurion on her journey of world regeneration. The purpose of the journey is to replenish Sylvarant with mana, a necessary energy to their survival.[NGC 1] The path of the journey consists of five temples which must be unsealed by Colette. On their journey, they meet Sheena Fujibayashi who comes from Tethe&#39;alla, a world parallel to Sylvarant. She tells them about how the two worlds vie for each other&#39;s mana through the journey of regeneration.[NGC 2] Hoping to find answers from the angel Remiel, the party meets him at the final seal and are betrayed by Remiel and Kratos; both are revealed to be part of Cruxis, an evil organization led by Mithos Yggdrasill.'),
(33, 'Crash Bandicoot 4: It&#39;s About Time', '54.50', 8, 4, 2020, 'Action-Adventure', 3, 'http://localhost/i211-final/gameShack_mvc/www/img/games/crash_bandicoot.jpg', 'Crash Bandicoot 4: It&#39;s About Time is a 2020 platform game developed by Toys for Bob and published by Activision. It was originally released for the PlayStation 4 and Xbox One, with releases for the PlayStation 5, Xbox Series X and Series S, Nintendo Switch, and Microsoft Windows following in 2021.'),
(34, 'Animal Crossing: New Horizons', '59.99', 4, 1, 2020, 'Social Simulation', 3, 'http://localhost/i211-final/gameShack_mvc/www/img/games/animal_crossing_nh.jpg', 'The game follows a villager customized by the player, who, after purchasing a getaway package from Tom Nook, moves into a deserted island. After Tom Nook gives the player essentials, such as a tent, the game proceeds in a non-linear fashion, allowing for the player to play the game as they choose.\r\n\r\nIn the Animal Crossing games, the player assumes the role of a human character who moves into a rural village populated with anthropomorphic animals, and lives there indefinitely. Gameplay is open-ended: players have no defined objectives, but are instead encouraged to spend their time in the village performing any number of activities which include collecting items, planting plants, bug-catching, fishing, and socializing with the village&#39;s residents. Animal Crossing games are played in real time, utilizing the video game console&#39;s internal clock and calendar. Thus, passage of time in the game world reflects that in reality, as well as the current season and time of day. Some in-game events, such as holidays or the growth of a tree, occur at certain times or require some duration of time to have passed.[11]'),
(35, 'Mario Kart 8 Deluxe', '49.99', 8, 1, 2014, 'Racing', 3, 'http://localhost/i211-final/gameShack_mvc/www/img/games/mario_kart_8.jpg', 'Hit the road with the definitive version of Mario Kart 8 and play anytime, any-where! Race your friends or battle them in a revised battle mode on new and returning battle courses. Play locally in up to 4-player multiplayer in 1080p while playing in TV Mode. Every track from the Wii U version, including DLC, makes a glorious return. Plus, the Inklings appear as all-new guest characters, along with returning favorites, such as King Boo, Dry Bones, and Bowser Jr.!'),
(46, 'Legend of Zelda: Twilight Princess', '29.99', 1, 1, 2006, 'Action-Adventure', 1, 'twilight_princess.jpg', 'The Legend Of Zelda: Twilight Princess brings you back tot he land of Hyrule, as you uncover the mystery behind its plunge into darkness. Link, a young man raised as a wrangler in a rural village, is ordered by the mayor to attend the Hyrule Summit. He sets off, oblivious to the dark fate that has descended upon the kingdom. When he enters the Twilight Realm that has covered Hyrule, he transforms into a wolf and is captured. A mysterious figure helps him break free, and with the aid of her magic, they set off to free the land from the shadows. Link must explore the vast land of Hyrule and As he does, he&#39;ll have to enlist the aid of friendly folk, solve puzzles and battle his way through dangerous dungeons. In the Twilight Realm, he&#39;ll have to use his wolf abilities and Midna&#39;s magic to bring light to the land. Revisit classic and new characters - Link, Zelda, Midna and many others');
