INSERT INTO `system` (`system_id`, `name`, `publisher_id`, `price`, `image`, `description`) VALUES
(1, 'Nintendo Wii', 1, '169.99', 'wii.jpg', 'Wii is a home console from Nintendo. Launched in 2006, it introduced motion controlled gaming to a wide audience of Nintendo fans and people who didn\'t traditionally play video games. A value model of Wii, Wii mini, was launched in 2013, allowing a new audience to enjoy Wii software. Wii mini does not connect to the Internet and does not support online features.'),
(2, 'XBox 360', 12, '149.49', 'xbox360.jpg', 'Microsoft\'s first video game console, the Xbox, has sold more than 20 million units worldwide since its introduction in 2001. Despite the Xbox\'s impressive power, the list of big-name video game titles to support it and the success of the Xbox\'s online component, Xbox LIVE, Sony\'s PlayStation 2 still outsold it.  As the game industry moved into the next generation of video game technology, Microsoft was determined to dethrone Sony\'s PlayStation. Enter the Xbox 360.'),
(3, 'Nintendo Gamecube', 1, '89.99', 'game_cube.jpg', 'The Nintendo GameCube is a game console in a cube format. The specially optimised 485 MHz processor with high-tech copper wire technology is complemented by state-of-the-art hardware which breaks down the boundary between the real world and video games. For instance, the \"Flipper\"-processor by ATI, which has been specially developed for Nintendo, provides crystal-clear graphics, bringing the enormous power of the Nintendo GameCube onto the screen.'),
(4, 'PlayStation 2', 6, '149.99', 'ps2.jpg', 'PlayStation 2 software is distributed on CD-ROM and DVD-ROM. In addition, the console can play audio CDs and DVD movies, and is backwards compatible with original PlayStation games. This is accomplished through the inclusion of the original PlayStation\'s CPU which also serves as the PS2\'s I/O processor.[1] The PS2 also supports limited functionality with the original PlayStation memory cards and controllers. The PS2\'s DualShock 2 controller is an upgraded version of the PlayStation\'s DualShock with analog face, shoulder and D-pad buttons replacing the digital buttons of the original.[2] Like its predecessor, the DualShock 2 controller features force feedback technology.'),
(5, 'PlayStation 4', 6, '279.99', 'ps4.jpg', 'The PlayStation 4 was released to critical acclaim, with critics praising Sony for acknowledging its consumers\' needs, embracing independent game development, and for not imposing the restrictive digital rights management schemes like those originally announced by Microsoft for the Xbox One. Critics and third-party studios, before its launch, also praised the capabilities of the PlayStation 4 in comparison to its competitors; developers described the performance difference between the console and Xbox One as \"significant\" and \"obvious.\" Heightened demand also helped Sony top global console sales. By October 2019, PS4 became the second best-selling home game console of all time, behind the PlayStation 2.'),
(6, 'Nintendo 3DS', 1, '339.50', 'nintendo3DS_XL.jpg', 'Nintendo 3DS system features real 3D graphics, no glasses needed! The Nintendo 3DS is a breakthrough in portable entertainment, a truly cutting-edge piece of hardware. The Nintendo 3DS opens up a whole new world of gaming possibilities with its stereoscopic 3D display. Imagine seeing Mario in the 3rd dimension or rescuing Zelda with mind blowing 3D graphics. It has to be seen to be believed. What if you don\'t want 3D graphics? The Nintendo 3DS allows you to adjust the intensity of the 3D effects and turn them off completely with the 3D depth slider should you need to give your eyes a break, or if you have children ages 6 and under whom play for extended sessions. The Nintendo 3DS gives you total control over your games from the built in Gyro sensor to the Circle Pad to the always trusted D pad and stylus. The gyro sensor allows you to use the device as the controller. Tilt the 3DS and watch the compatible game react. For the active gamer the 3DS offers the Activity log which rewards you for carrying the 3DS with you as you walk with in-game coins! Additionally StreetPass allows you to communicate and share your Mii and game information with random people you meet throughout the day. Pictures can be taken in 3D using the 3DS and its three built-in cameras. Your pictures will come to life in crystal clear 3D.'),
(7, 'Nintendo 64', 1, '62.50', 'n64.jpeg', 'The Nintendo 64, often referred to as N64, is Nintendo’s third home video game console for the international market. Named for its 64-bit central processing unit, it was released in June 1996 in Japan, September 1996 in North America. It is the industry’s last major home console to use the cartridge as its primary storage format, although current handheld systems (such as the PlayStation Vita and Nintendo 3DS) also use cartridges. While the Nintendo 64 was succeeded by Nintendo’s MiniDVD-based GameCube in November 2001, the consoles remained available until the system was retired in late 2003.'),
(8, 'Nintendo Switch', 1, '299.99', 'nintendo_switch.jpg', 'Introducing Nintendo Switch, the new home video game system from Nintendo. In addition to providing single and multiplayer thrills at home, the Nintendo Switch can be taken on the go so players can enjoy a full home Nintendo Switch console experience anytime, anywhere. The mobility of a handheld is now added to the power of a home gaming system, with unprecedented new play styles brought to life by the two new Nintendo Switch Joy-Con controllers.'),
(9, 'Super Nintendo', 1, '58.99', 'super_nintendo.jpg', 'The Super Nintendo Entertainment System (commonly shortened to Super Nintendo) is a 16-bit home video game console developed by Nintendo that was released in 1990 in Japan and South Korea, 1991 in North America.  The SNES is Nintendo’s second home console, following the Nintendo Entertainment System (NES). The console introduced advanced graphics and sound capabilities compared with other consoles at the time. The development of a variety of enhancement chips integrated in game cartridges helped to keep it competitive in the marketplace.');
