INSERT INTO `games` (`id`, `title`, `publisher`, `release_year`, `genre`, `platform`, `cover`, `description`) VALUES
(1, 'Wii Sports', 'Nietendo', 2006, 'Sports', 'Wii', 'wii_sports.jpg', 'Wii Sports is a sports game developed by Nintendo EAD and released on Wii.'),
(2, 'Super Mario Bros', 'Nintendo', 1985, 'Platform', 'NES', 'super_mario_bros.jpg', 'All new ways to Play and share your Mario Fun! New Super Mario Bros. & is a new, side-scrolling adventure featuring Mario, Luigi, Toad.... And your Mii character! Now\'s your chance to step inside the Mushroom Kingdom and explore new worlds, new power-ups and new ways to play.'),
(3, 'The Sims', 'Electronic Arts', 2000, 'Simulation', 'PC', 'sims.jpg', 'Let your Sims swim in the ocean on a hot summer day, bob for apples in the autumn leaves, test their snowboarding skill on the half pipe, or welcome spring showers with a walk in the rain and a colorful umbrella. All-new activities, like soccer, and big seasonal festivals and celebrations bring the spirit of each season to life. Your Sims can pucker up at the kissing booth at the spring festival, or see what Halloween surprises await in the haunted house. Dress for the weather with seasonal fashions from sun dresses to raincoats and snow gear. With new foods, dÃ©cor and weather effects, your Sims can enjoy the bounty and beauty of the ever-changing seasons and play with life like never before!'),
(4, 'Call of Duty: Modern Warfare 2', 'Activision', 2009, 'Shooter', 'PS3', 'call_of_duty.jpg', 'Call of Duty: Modern Warfare 3 is a first-person shooter video game, developed by Infinity Ward and Sledgehammer Games, with Raven Software having assisted in development. It is the third installment in the Modern Warfare series, a direct sequel to 2009\'s Call of Duty: Modern Warfare 2, and the eighth Call of Duty installment.'),
(5, 'Halo 3', 'Microsoft Games Studio', 2007, 'Shooter', 'XBOX 360', 'halo3.jpg', 'Halo 3 is a first-person shooter game developed by Bungie for the Xbox 360. It was announced at E3 2006 with a real-time cinematic trailer. It was released on September 25, 2007 in North America, September 26, 2007 in Europe and September 27, 2007 in Japan.<br>irst-day sales of Halo 3 reached $170 million in the U.S, setting a record for highest gross of an entertainment product within 24 hours of its release. The performance beat the previous record setter - Halo 2 - which earned $125 million within 24 hours after its launch.'),
(6, 'Grand of Theft Auto IV', 'Take-Two Interactive', 2008, 'Action', 'PS3', 'grand_theft_auto_iv.jpg', 'Grand Theft Auto: IV is the sixth 3D open-world game in the Grand Theft Auto franchise. It was released on the Xbox 360 and PS3 on April 29, 2008, and on the PC/Games For Windows port by Rockstar Toronto on 2/3 December 2008. <br>The new Rockstar Advanced Game Engine is used in the game, introducing the new era of the Grand Theft Auto franchise. It featured the first protagonist not to have been born or raised in North America, and became the best-selling game on launch day upon initial release.'),
(7, 'Just Dance 3', 'Ubisoft', 2011, 'Misc', 'Wii', 'just_dance_3.jpg', 'The world\'s #1 dance game* is back and the party is bigger than ever! The new Just Dance 3 gives a new twist to the already spontaneous and outrageous dance game. Just Dance 3 kick-starts the party with over 40 tracks from multiple genres and popular artists including today\'s hottest hits like \"Party Rock Anthem\" by LMFAO, \"California Gurls\" by Katy Perry featuring Snoop Dogg, and \"Forget You\" by Cee Lo Green. Also included are legendary favorites like \"I Was Made For Lovin\' You\" by Kiss. With a variety of all-new gameplay modes, tracks that allow up to 4 dancers to uniquely shine, and innovative cardio training options, Just Dance 3 was made to bring the party and keep America dancing!'),
(8, 'Wii Play', 'Nintendo', 2006, 'Misc', 'Wii', 'wii_play.jpg', 'Wii Play is a misc game developed by Nintendo EAD and released on Wii.'),
(9, 'Battlefield 3', 'Electronic Arts', 2011, 'Shooter', 'XBOX 360', 'battlefield_3.jpg', 'Battlefield 3 is a first-person shooter developed by EA DICE and published by Electronic Arts. It was first revealed in Game Informer magazine on February 3rd 2011, and was released in North America on October 25th 2011. It is the first main series Battlefield game to feature a single-player mode, and the eleventh Battlefield game in total.'),
(10, 'World of Warcraft', 'Activision', 2004, 'Role-playi', 'PC', 'world_of_warcraft.jpg', 'World of Warcraft is a massively multiplayer online role-playing game (MMORPG) developed and published by Blizzard Entertainment. It is the fourth installment in the Warcraft series, and Blizzard\'s first game in the MMORPG genre. The game takes place in the world of Azeroth, approximately four years after the events of Warcraft III: The Frozen Throne. Since its release on November 23rd, 2004, the 10th anniversary of the Warcraft franchise, the game has achieved massive levels of success. In December 2011, Blizzard announced that there were over 10 million active subscriptions to World of Warcraft around the world. It is currently the most popular MMORPG in the world.The game has received three expansion sets so far, with a fourth one in development. The first expansion set, called The Burning Crusade, was released on Januray 16th, 2007. The second expansion, Wrath of the Lich King, was released on Novermber 13th, 2008, and the third expansion, Cataclysm, was released on December 7th, 2010. The fourth expansion, called Mists of Pandaria, is currently in a closed beta testing phase.'),
(11, 'Tetris', 'Nintendo', 1988, 'Puzzle', 'NES', 'tetris.jpg', 'Tetris is a puzzle game developed by Bullet Proof Software and released on Game Boy, iOS, Nintendo Entertainment System, PlayStation 3, WonderSwan.'),
(12, 'Red Dead Redemption', 'Take-Two Interactive', 2010, 'Action', 'PS3', 'red_dead_redemption.jpg', 'Red Dead Redemption is a open world action-adventure game with a Western theme, released on May 18, 2010. The game revolutionized the Spaghetti Western video game genre and how the Old West is viewed to the average gamer, with use of Rockstar Games\' RAGE engine, used in Grand Theft Auto: IV two years prior. <br>The game chronicles the story of an outlaw by the name of John Marston, and the sequel to Red Dead Revolver, released six years after the initial release of the Red Dead franchise in 2004.');
INSERT INTO `movies` (`id`, `title`, `rating`, `release_date`, `director`, `image`, `description`) VALUES
(1, 'The Shawshank Redemption', 3, '1994-10-14', 'Ric Roman Waugh', 'the_shawshank_redemption.jpg', 'Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.'),
(2, 'The Godfather', 4, '1972-03-24', 'Francis Ford Coppola', 'the_godfather.jpg', 'The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son.'),
(3, 'The Godfather II', 4, '1974-12-20', 'Francis Ford Coppola', 'the_godfather_ii.jpg', 'The early life and career of Vito Corleone in 1920s New York is portrayed while his son, Michael, expands and tightens his grip on his crime syndicate stretching from Lake Tahoe, Nevada to pre-revolution 1958 Cuba.'),
(4, 'The Dark Knight', 3, '2008-07-18', 'Christopher Nolan', 'the_dark_knight.jpg', 'When Batman, Gordon and Harvey Dent launch an assault on the mob, they let the clown out of the box, the Joker, bent on turning Gotham on itself and bringing any heroes down to his level.'),
(5, 'Inception', 3, '2010-07-16', 'Christopher Nolan', 'inception.jpg', 'In a world where technology exists to enter the human mind through dream invasion, a highly skilled thief is given a final chance at redemption which involves executing his toughest job to date: Inception.'),
(6, 'Chocolate', 4, '2001-01-19', 'Lasse Hallstrom', 'chocolat.jpg', 'A woman and her daughter open a chocolate shop in a small French village that shakes up the rigid morality of the community.'),
(7, 'Raiders of the Lost Ark', 2, '1981-06-12', 'Steven Spielberg', 'raiders_of_the_lost_ark.jpg', 'Archeologist and adventurer Indiana Jones is hired by the US government to find the Ark of the Covenant before the Nazis.'),
(8, 'Life is Beautiful', 3, '1999-02-12', 'Roberto Benigni', 'life_is_beautiful.jpg', 'A Jewish man has a wonderful romance with the help of his humour, but must use that same quality to protect his son in a Nazi death camp.'),
(9, 'Aladdin', 1, '1992-11-25', 'Ron Clements', 'aladdin.jpg', 'Aladdin, a street urchin, accidentally meets Princess Jasmine, who is in the city undercover. They love each other, but she can only marry a prince.'),
(10, 'Secret of the Wings', 1, '2012-08-16', 'Roberts Gannaway', 'secret_of_the_wings.jpg', 'Tinker Bell meets Periwinkle and ventures into the winter woods with her and Tinker Bell\\\'s other friends to find the secret of fairy wings.'),
(11, 'Rio 2', 1, '2014-04-11', 'Carlos Saldanha', 'Rio2.jpg', 'It\'s a jungle out there for Blu, Jewel and their three kids after they\'re hurtled from Rio de Janeiro to the wilds of the Amazon. As Blu tries to fit in, he goes beak-to-beak with the vengeful Nigel, and meets the most fearsome adversary of all: his father-in-law.'),
(47, 'Transformers: Age of Extinction', 3, '2014-06-27', 'Michael Bay', 'Transformers Age of Extinction.jpg', 'As humanity picks up the pieces, following the conclusion of \"Transformers: Dark of the Moon,\" Autobots and Decepticons have all but vanished from the face of the planet. However, a group of powerful, ingenious businessman and scientists attempt to learn from past Transformer incursions and push the boundaries of technology beyond what they can control - all while an ancient, powerful Transformer menace sets Earth in his cross-hairs.'),
(13, 'Frozen', 2, '2013-11-19', 'Chris Buck, Jennifer Lee', 'Frozen.jpg', 'Young princess Anna of Arendelle dreams about finding true love at her sister Elsa\'s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. She\'s accompanied by ice delivery man Kristoff, his reindeer Sven, and snowman Olaf. On an adventure where she will find out what friendship, courage, family, and true love really means.'),
(14, 'Big Hero 6', 2, '2014-10-22', 'Don Hall, Chris Williams', 'https://image.tmdb.org/t/p/w185/yzZqtlGzsfnevAL7bnutcCCcKN.jpg', 'The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.'),
(15, 'The Terminator', 4, '1984-10-26', 'James Cameron', 'The Terminator.jpg', 'In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the \"Terminator\" back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?'),
(16, 'Let\'s Be Cops', 4, '2014-08-13', 'Luke Greenfield', 'Lets_be_cops.jpg', 'It\'s the ultimate buddy cop movie except for one thing: they\'re not cops. When two struggling pals dress as police officers for a costume party, they become neighborhood sensations. But when these newly-minted \"heroes\" get tangled in a real life web of mobsters and dirty detectives, they must put their fake badges on the line.'),
(17, 'The Avengers', 3, '2012-05-04', 'Joss Whedon', 'The Avengers.jpg', 'When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!'),
(18, 'The Hunger Games: Catching Fire', 3, '2013-11-22', 'Francis Lawrence', 'The Hunger Games Catching Fire.jpg', 'Katniss Everdeen has returned home safe after winning the 74th Annual Hunger Games along with fellow tribute Peeta Mellark. Winning means that they must turn around and leave their family and close friends, embarking on a \"Victor\'s Tour\" of the districts. Along the way Katniss senses that a rebellion is simmering, but the Capitol is still very much in control as President Snow prepares the 75th Annual Hunger Games (The Quarter Quell) - a competition that could change Panem forever.'),
(19, 'Star Wars: Episode IV - A New Hope', 2, '1977-05-25', 'George Lucas', 'Star Wars Episode IV A New Hope.jpg', 'Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.'),
(20, 'Iron Man 3', 3, '2013-05-03', 'Shane Black', 'https://image.tmdb.org/t/p/w185/1Ilv6ryHUv6rt9zIsbSEJUmmbEi.jpg', 'The brash-but-brilliant industrialist Tony Stark faces an enemy whose reach knows no bounds. When Stark finds his personal world destroyed at his enemy\'s hands, he embarks on a harrowing quest to find those responsible. This journey, at every turn, will test his mettle. With his back against the wall, Stark is left to survive by his own devices, relying on his ingenuity and instincts to protect those closest to him. As he fights his way back, Stark discovers the answer to the question that has secretly haunted him: does the man make the suit or does the suit make the man?'),
(21, 'The Lord of the Rings: Fellowship of the Ring', 3, '2001-12-19', 'Peter Jackson', 'The Lord of the Rings Fellowship of the Ring.jpg', 'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.'),
(22, 'St. Vincent', 3, '2014-10-31', 'Theodore Melfi', 'st_vincent.jpg', 'A young boy whose parents just divorced finds an unlikely friend and mentor in the misanthropic, bawdy, hedonistic, war veteran who lives next door.'),
(23, 'Avatar', 3, '2009-12-18', 'James Cameron', 'Avatar.jpg', 'In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.'),
(24, 'Star Wars Episode III - Revenge of the Sith', 3, '2005-05-19', 'George Lucas', 'Star Wars Episode III - Revenge of the Sith.jpg', '(19 Years before Episode IV) Three years after the onset of the Clone Wars, the Jedi Knights have been leading the clone army into a galaxy-wide war against the Separatists. Only by embracing the Dark Side can Anakin Skywalker end the war and -- He believes -- Save the woman he loves.'),
(25, 'Forest Gump', 3, '1994-06-22', 'Robert Zemeckis', 'Forest Gump.jpg', 'A man with a low IQ has accomplished great things in his life and been present during significant historic events - in each case, far exceeding what anyone imagined he could do. Yet, despite all the things he has attained, his one true love eludes him. \'Forrest Gump\' is the story of a man who rose above his challenges, and who proved that determination, courage, and love are more important than ability.'),
(26, 'Saving Private Ryan', 4, '1998-07-24', 'Steven Spielberg', 'Saving Private Ryan.jpg', 'As U.S. troops storm the beaches of Normandy, three brothers lie dead on the battlefield, with a fourth trapped behind enemy lines. Ranger captain John Miller and seven men are tasked with penetrating German-held territory and bringing the boy home.'),
(27, 'The Green Mile', 4, '1999-12-10', 'Frank Darabont', 'The Green Mile.jpg', 'A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people\'s ailments. When the cellblock\'s head guard, Paul Edgecomb, recognizes Coffey\'s miraculous gift, he tries desperately to help stave off the condemned man\'s execution.'),
(28, 'Road to Perdition', 4, '2002-07-12', 'Sam Mendes', 'https://image.tmdb.org/t/p/w185/jn0GH8klINSQtRNifY8W2Kv4ajl.jpg', 'Mike Sullivan works as a hit man for crime boss John Rooney. Sullivan views Rooney as a father figure, however after his son is witness to a killing, Mike Sullivan finds himself on the run in attempt to save the life of his son and at the same time looking for revenge on those who wronged him.'),
(29, 'The Reader', 4, '2008-12-10', 'Stephen Daldry', 'The Reader.jpg', 'Tells the story of Michael Berg, a German lawyer who as a teenager in the late 1950s had an affair with an older woman, Hanna, who then disappeared only to resurface years later as one of the defendants in a war crimes trial stemming from her actions as a concentration camp guard late in the war. He alone realizes that Hanna is illiterate and may be concealing that at the expense of her freedom.'),
(30, 'Cold Mountain', 4, '2003-12-24', 'Anthony Minghella', 'Cold Mountain.jpg', 'Cold Mountain is the film adaptation of the novel by the same name from Charles Frazier. A star-studded film taking place in North Carolina during the Civil War. The film portrays civilian life during the war from the perspective of a woman who has been left behind as the men fight.'),
(31, 'Australia', 3, '2008-11-26', 'Baz Luhrmann', 'Australia.jpg', 'Set in northern Australia before World War II, an English aristocrat who inherits a sprawling ranch reluctantly pacts with a stock-man in order to protect her new property from a takeover plot. As the pair drive 2,000 head of cattle over unforgiving landscape, they experience the bombing of Darwin, Australia, by Japanese forces firsthand.'),
(32, 'Moulin Rouge', 3, '2001-05-16', 'Baz Luhrmann', 'https://image.tmdb.org/t/p/w185/zsphaxX7NaZyFTYpdlo2yz7q7wy.jpg', 'A poet falls for a beautiful courtesan whom a jealous duke covets in this stylish musical, with music drawn from familiar 20th century sources.'),
(33, 'The Hours', 3, '2002-12-27', 'Stephen Daldry', 'The Hours.jpg', 'The Hours is a melancholy tragedy based on the book by Virginia Woolf “Mrs. Dalloway” about three women doomed with depression. Director Stephaen Daldry timelessly presents the life and psychotic changes of the exceptional English author which Nichole Kidman won the Oscar for best actress.'),
(34, 'Last Vegas', 3, '2013-11-01', 'Jon Turteltaub', 'Last Vegas.jpg', 'Three sixty-something friends take a break from their day-to-day lives to throw a bachelor party in Las Vegas for their last remaining single pal.'),
(37, 'Olympus Has Fallen', 4, '2013-03-22', 'Antoine Fuqua', 'Olympus Has Fallen.jpg', 'When the White House (Secret Service Code: \"Olympus\") is captured by a terrorist mastermind and the President is kidnapped, disgraced former Presidential guard Mike Banning finds himself trapped within the building. As the national security team scrambles to respond, they are forced to rely on Banning\'s inside knowledge to help retake the White House, save the President and avert an even bigger disaster.'),
(38, 'How to Train Your Dragon 2', 2, '2014-06-13', 'Dean DeBlois', 'How to Train Your Dragon 2.jpg', 'The thrilling second chapter of the epic How To Train Your Dragon trilogy brings back the fantastical world of Hiccup and Toothless five years later. While Astrid, Snotlout and the rest of the gang are challenging each other to dragon races (the island\'s new favorite contact sport), the now inseparable pair journey through the skies, charting unmapped territories and exploring new worlds. When one of their adventures leads to the discovery of a secret ice cave that is home to hundreds of new wild dragons and the mysterious Dragon Rider, the two friends find themselves at the center of a battle to protect the peace.'),
(39, 'Howl\'s Moving Castle', 2, '2004-06-10', 'Hayao Miyazaki', 'Howls Moving Castle.jpg', 'When Sophie, a shy young woman, is cursed with an old body by a spiteful witch, her only chance of breaking the spell lies with a self-indulgent yet insecure young wizard and his companions in his legged, walking home.'),
(40, 'The Big Blue', 3, '1988-05-11', 'Luc Besson', 'The Big Blue.jpg', 'Two men answer the call of the ocean in this romantic fantasy-adventure. Jacques (Jean-Marc Barr) and Enzo (Jean Reno) are a pair of friends who have been close since childhood, and who share a passion for the dangerous sport of free diving. Professional diver Jacques opted to follow in the footsteps of his father, who died at sea when Jacques was a boy; to the bewilderment of scientists, Jacques harbors a remarkable ability to adjust his heart rate and breathing pattern in the water, so that his vital signs more closely resemble that of dolphins than men (he even considers a school of dolphins as his extended family). As Enzo persuades a reluctant Jacques to compete against him in a free diving contest -- determining who can dive deeper and longer without scuba gear -- Jacques meets Johana (Rosanna Arquette), a beautiful insurance investigator from America, and he finds that he must choose between his love for her and his love of the sea.'),
(41, 'Harry Potter and the Philosopher\'s Stone', 2, '2001-11-14', 'Chris Columbus', 'https://image.tmdb.org/t/p/w185/uLGaJ9FgPWf7EUgwjp9RTmHemw8.jpg', 'Harry Potter has lived under the stairs at his aunt and uncle\'s house his whole life. But on his 11th birthday, he learns he\'s a powerful wizard -- with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school\'s kindly headmaster, Harry uncovers the truth about his parents\' deaths -- and about the villain who\'s to blame.'),
(42, 'Harry Potter and the Half-Blood Prince', 2, '2009-07-08', 'David Yates', 'Harry Potter and the Half-Blood Prince.jpg', 'The sixth year at Hogwarts School of Witchcraft and Wizardry kicks off with a bang for young Harry Potter when he inadvertently discovers a mysterious book that sheds light on the sordid life of the evil Lord Voldemort. Preparing for inevitable battle, Harry and Dumbledore turn to professor Horace Slughorn for help in pinpointing the weakness in Voldemort\'s forces.'),
(43, 'The Poker House', 4, '2008-06-20', 'Lori Petty', 'The Poker House.jpg', 'Actress Lori Petty makes her directorial debut with this poignant, beautifully crafted film about a teenage girl trying to survive the dismal circumstances of her life with dignity, humor, and basketball.'),
(44, 'Catch Me If You Can', 3, '2001-12-25', 'Steven Spielberg', 'https://image.tmdb.org/t/p/w185/MywWCQGJNUr5kivAQ7eseCG7rm.jpg', 'Frank W. Abagnale Jr. is a cunning con man -- posing as a doctor, lawyer and pilot all before turning 21. He\'s also a deft forger, and his work attracts the attention of FBI agent Carl Hanratty, who makes it his mission to put Frank behind bars. But Frank not only eludes capture, he revels in the pursuit, even taking time to taunt Carl by phone.'),
(45, 'The Lake House', 2, '2006-06-16', 'Alejandro Agresti', 'The Lake House.jpg', 'A lonely doctor who once occupied an unusual lakeside home begins exchanging love letters with its former resident, a frustrated architect. They must try to unravel the mystery behind their extraordinary romance before it\'s too late.'),
(48, 'Kung Fu Panda', 2, '2008-06-05', 'Mark Osborne, John Stevenson', 'Kung Fu Panda.jpg', 'When the Valley of Peace is threatened, lazy Po the panda discovers his destiny as the \"chosen one\" and trains to become a kung fu hero, but transforming the unsleek slacker into a brave warrior won\'t be easy. It\'s up to Master Shifu and the Furious Five -- Tigress, Crane, Mantis, Viper and Monkey -- to give it a try.'),
(49, 'Kung Fu Panda 2', 2, '2011-05-25', 'Jennifer Yuh', 'Kung Fu Panda 2.jpg', 'Po is now living his dream as The Dragon Warior, protecting the Valley of Peace alongside his friends and fellow kung fu masters, The Furious Five - Tigress, Crane, Mantis, Viper and Monkey. But Poâ€™s new life of awesomeness is threatened by the emergence of a formidable villain, who plans to use a secret, unstoppable weapon to conquer China and destroy kung fu. It is up to Po and The Furious Five to journey across China to face this threat and vanquish it. But how can Po stop a weapon that can stop kung fu? He must look to his past and uncover the secrets of his mysterious origins; only then will he be able to unlock the strength he needs to succeed.'),
(50, 'Kung Fu Panda Holiday', 1, '2010-11-26', 'Tim Johnson', 'Kung Fu Panda Holiday.jpg', 'The Winter Feast is Po\'s favorite holiday. Every year he and his father hang decorations, cook together, and serve noodle soup to the villagers. But this year Shifu informs Po that as Dragon Warrior, it is his duty to host the formal Winter Feast at the Jade Palace. Po is caught between his obligations as the Dragon Warrior and his family traditions: between Shifu and Mr. Ping.'),
(51, 'Kung Fu Panda 3', 2, '2016-03-16', 'Jennifer Yuh', 'kung_fu_panda_3.jpg', 'Continuing his \"legendary adventures of awesomeness\", Po must face two hugely epic, but different threats: one supernatural and the other a little closer to his home.'),
(52, 'Kung Fu Panda: Secrets of the Masters', 5, '2011-12-12', 'Anthony Leondis', 'Kung Fu Panda Secrets of the Masters.jpg', 'Po and the Furious Five uncover the legend of three of kung fu\'s greatest heroes: Master Thundering Rhino, Master Storming Ox, and Master Croc.'),
(53, 'Kung Fu Panda: Secrets of the Furious Five', 2, '2008-11-08', 'Raman Hui', 'Kung Fu Panda Secrets of the Furious Five.jpg', 'Ordered to teach a martial arts class of rambunctious bunny kittens, Po tells stories of each of the Furious Five\'s pasts.'),
(58, 'American Sniper', 3, '2015-01-16', 'Clint Eastwood', 'american_sniper.jpg', 'Navy SEAL sniper Chris Kyle\'s pinpoint accuracy saves countless lives on the battlefield and turns him into a legend. Back home to his wife and kids after four tours of duty, however, Chris finds that it is the war he can\'t leave behind.');
