INSERT INTO `plants` (`id`, `plant_name`, `plant_type_id`, `care_instructions`, `price`, `image`) VALUES
(1, 'Rabbit&#39;s Foot', 1, 'Watering: Keep soil moist at all times during spring and summer months.\r\nLight: At least 6-8 hours of direct sunlight.\r\nTemperature: 60-75ºF. No lower than 55ºF.', '16.50', 'images/rabbitsFoot.jpeg'),
(2, 'Lady&#39;s Slippers', 1, 'Watering: Water once a week (or when the top inch of growing medium feels dry to the touch) and allow the roots to drain fully.\r\nLight: Low indirect sunlight.\r\nTemperature: 75-80°F/days. 60-65°F/nights. A humid environment is best.', '10.95', 'images/orchid.jpeg'),
(3, 'Bunny Ears', 2, 'Watering: Keep soil moist but avoid soggy soil during summer season. Do no water at all during the winter. \r\nLight: Full light for the majority of the year. Partial sunlight during the winter.\r\nTemperature: 70-100°F but demands cooler temperature during winter months. Cactus should be kept between 50-65° and away from central heating vent during the cooler season.', '19.50', 'images/bunnyEars.jpeg'),
(4, 'Aloe Vera', 1, 'Watering: Avoid letting the soil get dry and keep moist. Water very sparingly during the winter season.\r\nLight: Bright indirect light. Avoid direct sunlight. \r\nTemperature: 70°F-80°F. Do not let it reach below 50°F.', '13.55', 'images/aloeVera.jpeg'),
(5, 'Flamingo Flower', 3, 'Watering: Keep soil moist during the entire summer season. Water a few times a week during the winter months. \r\nLight: Plenty of indirect sunlight. Avoid direct sunlight. \r\nTemperature: 65°F - 75°F', '25.90', 'images/flamingo.jpeg'),
(7, 'Christmas Cacti', 2, 'Watering: Keep top inch of soil moist at all times. Never allow the soil to sit in water.\r\nLight: Direct sunlight during the fall and winter seasons. Partial sun during the spring and summer months. Too much light during the warmer seasons will cause the plant to turn yellow and fail to produce buds in the coming year.\r\nTemperature: Best kept at 68°F. 60-70°F are tolerated. Plant death can occur at below 50°F.', '16.80', 'images/christmasCacti.jpeg'),
(8, 'Lollipop Plant', 3, 'Watering: Keep the soil damp and water frequently during summer. Water less during the winter season.\r\nLight: Plenty of daylight. Avoid direct sunlight.\r\nTemperature: 65°F-75°F', '35.50', 'images/lollipop.jpeg'),
(9, 'Panda Plant', 1, 'Watering: Only water once the soil has become dry. Do not leave water in the bottom tray. Water less during the winter\r\nLight: A combination of direct, indirect and shade is a good balance of sunlight for this plant.\r\nTemperature:60ºF-75ºF', '28.90', 'images/pandaPlant.jpeg');
